import React from 'react'

class TableHeaders extends React.Component {
  render(){

    return(
        <thead>
          <th>name</th>          
          <th>rotation_period</th>
          <th>orbital_period</th>
          <th>diameter</th>
          <th>climate</th>
          <th>gravity</th>
          <th>terrain</th>
          <th>surface_water</th>
          <th>population</th>
          <th>films</th>
          <th>created</th>
          <th>edited</th>
          <th>url</th>
        </thead>   
    )
  }

}
export default TableHeaders;
